import { Outlet } from "react-router-dom";

export default function Sidebar() {
  const sidebarList = [
    {
      id: 1,
      title: "Installation",
      path: "#installation",
    },
    {
      id: 2,
      title: "Button Component",
      path: "#buttonCompoent",
    },
  ];
  const listItem = sidebarList.map((items) => (
    <li key={items.id}>
      <Link to={items.url}>{items.title}</Link>
    </li>
  ));
  return (
    <>
      <aside>
        <div class="sidebar">
          <ul>{listItem}</ul>
        </div>
      </aside>
    </>
  );
}
